const API_URL = "http://178.128.123.212:5000/api/v1/admin/companies";
function mapCompany(apiData) {
    return {
        id: apiData.company_id,
        name: apiData.company_name,
        address: apiData.address,
        provinceId: apiData.province_id,
        products: apiData.products?.map((p)=>({
                id: p.product_id,
                name: p.product_name_th || p.product_name_en,
                status: p.verify_status || "N/A"
            })) || []
    };
}
const CompanyService = {
    getCompanies () {
        return fetch(API_URL, {
            headers: {
                "Cache-Control": "no-cache"
            }
        }).then((res)=>{
            if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);
            return res.json();
        }).then((data)=>data.map(mapCompany));
    },
    getCompanyById (id) {
        return fetch(`${API_URL}/${id}`, {
            headers: {
                "Cache-Control": "no-cache"
            }
        }).then((res)=>{
            if (!res.ok) throw new Error(`HTTP error! status: ${res.status}`);
            return res.json();
        }).then(mapCompany);
    }
};

